import { Link } from "react-router-dom";

export default function LoginPage() {
  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="p-10 bg-white rounded-lg shadow-xl w-20">
        {/* Input fields inside this container will stack vertically */}
        <input
          type="email"
          placeholder="Your Email"
          className="border-2 border-gray-300 bg-white h-10 px-5 mb-4 rounded-lg text-sm focus:outline-none w-full"
        />
        <input
          type="password"
          placeholder="Your Password"
          className="border-2 border-gray-300 bg-white h-10 px-5 mb-4 rounded-lg text-sm focus:outline-none w-full"
        />
        <button type="submit" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded w-full">
          Log In
        </button>
      </div>
    </div>
  );
}
